import React from "react";

const ChangePassword = () => {
    return (
        <>
            <h1 className="font-bold text-xl text-center my-5">Change Password</h1>
            <div className="flex justify-center p-10">
                <div className="w-full max-w-sm bg-white border-4 border-primary rounded-3xl shadow-lg">
                    <div className="flex flex-col items-center py-10">
                        <form>
                            <div>
                                <label htmlFor="title" className="block mb-2 text-sm font-semibold text-primary ">
                                    Job Name
                                </label>
                                <input
                                    type="text"
                                    id="title"
                                    name="title"
                                    className="bg-tertiary border font-medium border-secondary text-primary text-sm rounded-2xl focus:ring-primary focus:border-primary block w-full p-2.5 placeholder-gray-50"
                                    placeholder="job name ..."
                                    required
                                    onChange={handleInput}
                                    value={input.title}
                                />
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        </>
    );
};

export default ChangePassword;
